import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        while (true) {
            int U_W = scanner.nextInt();
            int U_H = scanner.nextInt();
            int A = scanner.nextInt();
            int B = scanner.nextInt();
            int A_cap_B = scanner.nextInt();

            if (U_W == 0 && U_H == 0 && A == 0 && B == 0 && A_cap_B == 0) {
                break;
            }

            double R_A = Math.sqrt((double) A);
            double R_B = Math.sqrt((double) B - (double) A_cap_B);

            if (R_A + R_B > Math.min(U_W, U_H) - 0.0001) {
                System.out.println("impossible");
                continue;
            }

            double X_A = U_W / 2 + (R_A - R_B) / 2;
            double Y_A = U_H / 2;
            double X_B = U_W / 2 - (R_A - R_B) / 2;
            double Y_B = U_H / 2;

            if (X_A - R_A < -0.0001 || X_A + R_A > U_W + 0.0001 ||
                Y_A - R_A < -0.0001 || Y_A + R_A > U_H + 0.0001 ||
                X_B - R_B < -0.0001 || X_B + R_B > U_W + 0.0001 ||
                Y_B - R_B < -0.0001 || Y_B + R_B > U_H + 0.0001) {
                System.out.println("impossible");
                continue;
            }

            double area_A = Math.PI * R_A * R_A;
            double area_B = Math.PI * R_B * R_B;
            double area_A_cap_B = Math.PI * Math.pow((R_A - R_B) / 2, 2);

            if (Math.abs(area_A - A) > 0.0001 || Math.abs(area_B - B + A_cap_B) > 0.0001 || Math.abs(area_A_cap_B - A_cap_B) > 0.0001) {
                System.out.println("impossible");
                continue;
            }

            System.out.printf("%.6f %.6f %.6f %.6f %.6f %.6f%n", X_A, Y_A, R_A, X_B, Y_B, R_B);
        }
    }
}
